map.on("load", () => {
  map.addSource("Earthquake", {
    type: "geojson",
    data: geojsonData
  });

  // Heatmap Layer
  map.addLayer({
    id: "Earthquake-heatmap",
    type: "heatmap",
    source: "Earthquake",
    maxzoom: 15,
    paint: {
      "heatmap-weight": ["interpolate", ["linear"], ["get", "mag"], 1, 0, 6, 1],
      "heatmap-intensity": ["interpolate", ["linear"], ["zoom"], 0, 1, 10, 3],
      "heatmap-color": [
        "interpolate", ["linear"], ["heatmap-density"],
        0, "rgba(0,0,255,0)",
        0.2, "blue",
        0.4, "lime",
        0.6, "yellow",
        0.8, "orange",
        1, "red"
      ],
      "heatmap-radius": ["interpolate", ["linear"], ["zoom"], 0, 2, 9, 20],
      "heatmap-opacity": 0.8
    }
  });

  // Circle Layer
  map.addLayer({
    id: "Earthquake-layer",
    type: "circle",
    source: "Earthquake",
    minzoom: 8,
    paint: {
      "circle-color": [
        "interpolate", ["linear"], ["get", "mag"],
        1, "#00BCD4",
        3, "#FFC107",
        5, "#FF5722"
      ],
      "circle-radius": [
        "interpolate", ["linear"], ["get", "mag"],
        1, 4,
        6, 20
      ],
      "circle-opacity": 0.9
    }
  });

  // Popup on circle click
  map.on("click", "Earthquake-layer", (e) => {
    const feature = e.features[0];
    const props = feature.properties;
    const coords = feature.geometry.coordinates;
    new maplibregl.Popup()
      .setLngLat(coords)
      .setHTML(`
        <strong>📍 Earthquake Info</strong><br/>
        <strong>Place:</strong> ${props.place}<br/>
        <strong>Magnitude:</strong> ${props.mag}<br/>
        <strong>Time:</strong> ${props.time}<br/>
      `)
      .addTo(map);
  });

  map.on("mouseenter", "Earthquake-layer", () => {
    map.getCanvas().style.cursor = "pointer";
  });
  map.on("mouseleave", "Earthquake-layer", () => {
    map.getCanvas().style.cursor = "";
  });
});
map.addControl(new maplibregl.NavigationControl(), 'top-left');
  map.addControl(new maplibregl.ScaleControl({
    maxWidth: 100,       // max width of the scale bar (optional)
    unit: 'metric'       // use 'imperial' if you want miles instead of meters/km
  }), 'bottom-left');